
DROP TABLE IF EXISTS "sf_district" CASCADE;

CREATE TABLE "sf_district" ( "sfdistrict_id" SERIAL, CONSTRAINT "sf_neighborhood_pk" PRIMARY KEY ("sfdistrict_id"),
"dgeom"  GEOMETRY,
"link" VARCHAR(254),
"name" VARCHAR(254)
 );


CREATE INDEX "sf_neighborhood_wkb_geometry_geom_idx" ON "sf_district" USING GIST ("dgeom" );



